            "بەخێربێیت! وەک بەکارهێنەرێکی میوان، دەتوانیت بەشێکی زۆری ئەپەکە بگەرێیت بەبێ دروستکردنی هەژمار. تایبەتمەندی و سەلامەتیت لای ئێمە زۆر گرنگە. ئەم سیاسەتە ڕوونی دەکاتەوە کە چۆن زانیاری کۆدەکەینەوە، بەکاریدەهێنین و دەیپارێزین لە ناو ئەپڵیکەیشنەکەدا.\n\n١. ئەو زانیارییانەی لەوانەیە کۆی بکەینەوە\n\nتەنانەت بەبێ تۆمارکردنیش، ئەپەکە لەوانەیە داتای تەکنیکی سنووردار کۆبکاتەوە وەک:\n\n- جۆری ئامێر، سیستەمی کارپێکردن، و وەشانی ئەپ\n- چالاکییەکانی ناو ئەپەکە (کلیکەکان، لاپەڕە سەردانکراوەکان، گەڕانە ئەنجامدراوەکان)\n- پەسەندکراوەکانی موڵک کە لەسەر ئامێرەکەت خەزنکراون (تەنها لەسەر مۆبایلەکەی خۆت)\n\nئێمە زانیاری کەسی وەک ناو، ئیمەیڵ، یان ژمارەی تەلەفۆن کۆناکەینەوە مەگەر خۆت بڕیاری تۆمارکردن بدەیت.\n\n٢. چۆن داتا بەکاردەهێنین\n\nداتا کۆکراوەکان یارمەتیمان دەدەن بۆ:\n\n- باشترکردنی ئەزموونی ئەپڵیکەیشنەکە\n- چاککردنی هەڵەکان و باشترکردنی کارایی\n- نیشاندانی موڵکی پەیوەندیدار و ئۆفیسە نزیکەکان\n- بیرهێنانەوەی لیستە دڵخوازە کاتییەکانت و هەڵبژاردنەکان لەسەر ئامێرەکەت\n\n٣. وێنەی موڵک و ناوەڕۆکی ئۆفیس\n\nئەگەر سەیری لیستی موڵکەکان یان بڵاوکراوەی ئۆفیسەکان بکەیت:\n\n- وێنەکان لە سێرڤەری پارێزراوەوە نیشان دەدرێن\n- ئێمە دەستکاری یان شیکردنەوە بۆ ناوەڕۆکی وێنەکان ناکەین جگە لە پێشکەشکردنی لە ئەپەکەدا\n- هیچ زانیارییەکی کەسی (Metadata) لە وێنەکان دەرناهێنرێت\n\n٤. لیستی دڵخواز و خەزنکردنی کاتی\n\nوەک میوان:\n\n- دەتوانیت موڵکەکان لە لیستی دڵخواز (Wishlist) پاشەکەوت بکەیت، کە تەنها لەسەر ئامێرەکەت دەمێنێتەوە\n- ئەگەر دواتر هەژمار دروست بکەیت، سیستەمەکە لەوانەیە پێشنیاری گواستنەوەیان بکات بۆ پرۆفایلەکەت (بە ڕەزامەندی خۆت)\n\n٥. هاوبەشکردنی داتا\n\nئێمە هەرگیز:\n\n- داتای کەسی تۆ بۆ مەبەستی بازاڕگەری (Marketing) نافرۆشین یان هاوبەش ناکەین\n- تۆماری چالاکی میوان نادەین بە لایەنی سێیەم\n- وردەکاری پەیوەندی ئۆفیس هاوبەش ناکەین جگە لەوەی ئۆفیسەکە خۆی لە ناو ئەپەکەدا بڵاوی دەکاتەوە\n\nئێمە تەنها داتای شیکاری نەناسراو (Anonymous) بەکاردەهێنین بۆ پێوانی ڕەوتی گشتی بەکارهێنانی ئەپەکە.\n\n٦. ڕێکارەکانی ئاسایش\n\nبۆ پاراستنی داتاکانت، ئێمە ئەمانە بەکاردەهێنین:\n\n- پەیوەندییە کۆدکراوەکان (HTTPS)\n- خەزنکردنی پارێزراوی وێنە بە یاسای دەسەڵاتی توند\n- پشکنینی بەردەوامی ئاسایشی سێرڤەر\n- سنووردارکردنی دەسەڵاتی گەیشتن بە داتابەیس تەنها بۆ گەشەپێدەرە ڕێگەپێدراوەکان\n\n٧. بەستەرە دەرەکییەکان\n\nئەپەکە لەوانەیە بەستەری تێدابێت بۆ:\n\n- وێبسایتی ئۆف"),
